sys_variable_value.value:
(function execute(inputs, outputs) {
  try {
    var successStatusCodes = ['201'];
    var errorMessages = {
      'Group Not Found': 'Invalid group - not found.',
      'Forbidden': 'Invalid credentials - forbidden.',
      'Unauthorized': 'Invalid credentials - unauthorized.',
      'already exists in source': 'Bad request - user access request already exists.',
    };
    var callbackFunction = function(inputs, outputs, errorMessages) {
      var responseBody = JSON.parse(inputs.responseBody);
      outputs.id = responseBody.id;
      outputs.state = responseBody.state;
      return outputs;
    };
    outputs = new x_snc_gitlab.GitLabUtils().postProcess(inputs, outputs, errorMessages, successStatusCodes, callbackFunction);
  } catch (e) {
    outputs = new x_snc_gitlab.GitLabErrorHandler(e).handleError(inputs, outputs, errorMessages);
  }
})(inputs, outputs);

